```solidity
pragma solidity 0.6.12;

contract YourContract {
    mapping (address => mapping (bytes32 => uint)) public orders;
    mapping (address => mapping (bytes32 => uint)) public orderfills;
    mapping (address => mapping (address => uint)) public balanceOf;
    mapping (address => uint160) public admin;
    mapping (address => address) private addressOfBountyMembers;
    address public feeaccount;
    address public accountlevelsaddr;
    uint256 public feemake;
    uint256 public feetake;
    uint256 public feerebate;

    function order(address _tokenGet, uint256 _amountGet, address _tokenGive, uint256 _amountGive, uint256 _expires, uint256 _nonce) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), _tokenGet, _amountGet, _tokenGive * 0x1000000000000000000000000, _amountGive, _expires, _nonce));
        orders[msg.sender][v0] = 1;
    }

    function cancelOrder(address _tokenGet, uint256 _amountGet, address _tokenGive, uint256 _amountGive, uint256 _expires, uint256 _nonce, uint8 _v, bytes32 _r, bytes32 _s) public {
        bytes32 v0 = sha256(abi.encodePacked(address(this), _tokenGet, _amountGet, _tokenGive * 0x1000000000000000000000000, _amountGive, _expires, _nonce));
        if(orders[msg.sender][v0] != 0){
            orderfills[msg.sender][v0] = _amountGet;
        } else {
            address v1 = ecrecover(keccak256(abi.encodePacked("0x19457468657265756d205369676e6564204d6573736167653a0a3332", v0)), _v, _r, _s);
            if(v1 != address(0)){
                orderfills[msg.sender][v0] = _amountGet;
            }
        }
    }

    function changeFeeMake(uint256 _feemake) public {
        require(_feemake <= feemake && msg.sender == admin[msg.sender], "Invalid operation");
        feemake = _feemake;
    }

    function withdraw(uint256 _amount) public {
        require(_amount <= addressOfBountyMembers[msg.sender] && _amount <= admin[msg.sender], "Invalid operation");
        admin[msg.sender] -= _amount;
        payable(msg.sender).transfer(_amount);
    }

    function changeFeeAccount(address _feeaccount) public {
        require(msg.sender == admin[msg.sender], "Invalid operation");
        feeaccount = _feeaccount;
    }

    function changeFeeRebate(uint256 _feerebate) public {
        require(_feerebate >= feerebate && _feerebate <= feetake && msg.sender == admin[msg.sender], "Invalid operation");
        feerebate = _feerebate;
    }

    function changeAdmin(address _admin) public {
        require(msg.sender == admin[msg.sender], "Invalid operation");
        admin[msg.sender] = uint160(_admin);
    }

    function depositToken(address _token, uint256 _amount) public {
        require(_token != address(0), "Invalid operation");
        (bool v0,) = _token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), _amount));
        require(v0 && (balanceOf[_token][msg.sender] + _amount >= _amount) && (balanceOf[_token][msg.sender] + _amount >= balanceOf[_token][msg.sender]), "Invalid operation");
        balanceOf[_token][msg.sender] += _amount;
    }

    function changeFeeTake(uint256 _feetake) public {
        require(_feetake >= feerebate && _feetake <= feetake && msg.sender == admin[msg.sender], "Invalid operation");
        feetake = _feetake;
    }

    function changeAccountLevelsAddr(address _accountlevelsaddr) public {
        require(msg.sender == admin[msg.sender], "Invalid operation");
        accountlevelsaddr = _accountlevelsaddr;
    }

    function deposit() public payable {
        require((msg.value + admin[msg.sender] >= admin[msg.sender]) && (msg.value + admin[msg.sender] >= msg.value), "Invalid operation");
        admin[msg.sender] += uint160(msg.value);
    }

    function withdrawToken(address _token, uint256 _amount) public {
        require(_token != address(0) && _amount <= balanceOf[_token][msg.sender], "Invalid operation");
        balanceOf[_token][msg.sender] -= _amount;
        (bool success,) = _token.call(abi.encodeWithSignature("transfer(address,uint256)", msg.sender, _amount));
        require(success, "Transfer failed");
    }
}
